void UIDrawTextbox(int UIEId) {
  while (Busy) delay(5);
  Busy = true;
    M5.Lcd.fillRect(UIElements[UIEId].x, UIElements[UIEId].y, UIElements[UIEId].width, UIElements[UIEId].height, 0xffff);
    int N = UIElements[UIEId].height / Char2Height; // сколько строк всего
    int P = UIElements[UIEId].width / Char2Width; // символов в строке
    int J = N * P; // всего можно уместить символов
    M5.Lcd.setTextSize(2);
    M5.Lcd.setTextColor(UIElements[UIEId].color);
    for (int j = 0, n = 0, p = 0; j < (*UIElements[UIEId].rootVar).length(); j++)
    {
      if ((*UIElements[UIEId].rootVar)[j] != '\n')
      {
        M5.Lcd.setCursor((UIElements[UIEId].x + (p * Char2Width)), UIElements[UIEId].y + (n * Char2Height));
        M5.Lcd.print((*UIElements[UIEId].rootVar)[j]);
        p++;
      }
      if (((*UIElements[UIEId].rootVar)[j] == '\n') || (p >= P))
      {
        n++;
        p = 0;
      } 
      if ((n >= N) || (j >= J)) break;
    }
  Busy = false;
}

